        by EMI at 16 after a recommendation from Pink Floyd''s David Gilmour, Kate
        Bush (born 30 July 1958 in Bexleyheath, England) has a uniquely individual
        style. Noted for her fragile yet emotionally charged material \u2013 rich
        in imagery and literary allusions \u2013 she''s an elusive legend. The daughter
        of an English doctor and an Irish mother, she studied dance under Lindsay
        Kemp before releasing her debut solo album The Kick Inside in 1978. Including
        smash hits \"Wuthering Heights\" and \"The Man With the Child in His Eyes,\"
        Kate Bush''s multi-media approach, soaring voice, and rampant imagination
        instantly announced a special talent. Her only tour took place in 1979 as
        she painstakingly concentrated on perfecting studio techniques, drawing on
        a broad range of influences and ambitious visuals with the albums Lionheart
        (1979), Never for Ever (1980), and the groundbreaking The Dreaming (1982).
        Her classic hits include \"Babooshka,\" \"Army Dreamers,\" \"Running Up That
        Hill,\" \"Cloudbusting\" and \"Don''t Give Up\" with Peter Gabriel, but new
        material has been increasingly scarce, with a 12-year gap between 1993''s
        The Red Shoes and 2005''s Aerial, which was distributed as a double LP and
        made the Top 3 in both Germany and the UK. Her tenth studio album, 50 Words
        for Snow, emerged in 2011, which yielded the single \"Wild Man.\" In 2014,
        she re-emerged to carry out a 22-night headline residency, Before the Dawn,
        which took place at London Hammersmith Apollo. She published her first book,
        a compilation of lyrics called How to Be Invisible, in 2018, and the following
        year dropped a compilation of rare tracks, cover versions, and remixes from
        the boxsets, The Other Sides. In 2022, her hit 1985 single \"Running Up That
        Hill\" was given a new lease of life and a fresh lick of UK chart success
        after it was featured on the soundtrack for season four of the popular Netflix
        series Stranger Things. In June 2022, the track went to number 8 on the UK
        Top 100 Singles Chart and peaked at number 8 on the US Billboard Hot 100,
        becoming Kate Bush''s first US top ten hit. She also landed her first-ever
        Billboard number one album with 1985''s Hounds of Love, on which the track
        is included.<\/p>","SOURCE":"Music Story"},"SELECTED_PLAYLIST":{"data":[{"PLAYLIST_ID":"4880894784","TITLE":"100%
